STOP DOING CRUNCHES and try these deep core exercises instead ⬇️

1. Dead Bugs: Keep the spine neutral at all times and think about drawing the belly button down towards your spine the entire movement. Beginner’s should try w/out a ball first.
2. Bird Dog Crunch: Strengthens the core as well as improves balance & stability. Think about drawing your abs towards your spine the entire time. 

BENEFITS 👉🏼 Both of these exercises target the deep core muscles. Strong abs helps reduce back pain, improves balance & the pelvic floor (great for moms & post pregnancy!)

