3 ways to hip thrust without a barbell. Strictly up to you if you choose to barbell hip thrust while pregnant, but this mom to be (& personal trainer) is choosing NOT to. Simply because I do not want that weight load on my pelvis. Here are 3 variations for you to try ⬇️ 

1. Body Weighted : allows you to really focus on mind to muscle connection 

2. Banded : place a glute band above the knees & focus on driving them outwards as you perform the movement 

3. Single Leg : OUCH these are the hardest but oh so good for the glutes & hamstrings

Pregnant or not all three of these variations are tough 😅 

